{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/oscarduvan/case-study-of-bellabeat?scriptVersionId=150565006\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"e880003f","metadata":{"papermill":{"duration":0.014142,"end_time":"2023-11-13T18:19:50.136518","exception":false,"start_time":"2023-11-13T18:19:50.122376","status":"completed"},"tags":[]},"source":["# Case study of BellaBeat"]},{"cell_type":"markdown","id":"323eea1c","metadata":{"papermill":{"duration":0.012239,"end_time":"2023-11-13T18:19:50.163657","exception":false,"start_time":"2023-11-13T18:19:50.151418","status":"completed"},"tags":[]},"source":["# Introduction\n","The following practical case study of BellaBeat is provided by the Google Analytics Certificate, which simulates a real-world scenario to apply each of the acquired knowledge during the certification. The process of data analysis will follow the steps: **ask, prepare, process, analyze, share, and act.**\n","\n","### About the Company\n","Urška Sršen and Sando Mur founded Bellabeat, a high-tech company that manufactures smart products focused on health care. Sršen used her artistic experience to develop technology with a beautiful design that informs and inspires women worldwide. Collecting data on physical activity, sleep, stress, and reproductive health has allowed Bellabeat to provide women with insights into their own health and habits. Since its founding in 2013, Bellabeat has grown rapidly and quickly positioned itself as a technology-driven wellness company for women.\n","\n","### Products\n","* **Bellabeat App**: The app provides users with health data related to their physical activity, sleep, stress, menstrual cycle, and mindfulness habits.\n","* **Leaf**: Bellabeat's classic wellness tracking device that can be worn as a bracelet, necklace, or clip.\n","* **Time**: This wellness watch combines the timeless look of a classic watch with smart technology to track the user's physical activity, sleep, and stress.\n","* **Spring**: A water bottle that tracks daily water consumption using smart technology to ensure proper hydration throughout the day.\n","* **Bellabeat Membership**: The membership provides users with 24/7 access to fully personalized guidance on nutrition, physical activity, sleep, health and beauty, and mindfulness based on the user's lifestyle and goals.\n","\n","# Phase 1: Ask\n","\n","Sršen knows that analyzing the available consumption data from Bellabeat would reveal new growth opportunities. She asked the marketing data computational analysis team to focus on a Bellabeat product and analyze the usage data of smart devices to understand how people are using their smart devices. With this information, she would like to receive high-level recommendations on how these trends can collaborate in Bellabeat's marketing strategy.\n","\n","### Stakeholders\n","* Urška Sršen: Co-founder and creative director of Bellabeat\n","* Sando Mur: Mathematician and co-founder of Bellabeat, key member of the Bellabeat executive team.\n","* Bellabeat Marketing Data Analysis Team: A team of data analysts responsible for collecting, analyzing, and reporting data to help drive Bellabeat's marketing strategy.\n","\n","### Questions to Answer\n","1. What are some trends in the use of smart devices?\n","2. How could these trends be applied to Bellabeat's customers?\n","3. How could these trends help influence Bellabeat's marketing strategy?\n","\n","### Business Task\n","* Improve the marketing strategy of Bellabeat to increase the customer portfolio\n","\n","# Phase 2: Prepare\n","\n","The data used for the analysis is publicly available data collected by Mobius and stored on Kaggle. The dataset contains personal physical activity tracking data for thirty Fitbit users. It consists of 18 files in long format in Excel spreadsheets with CSV extension.\n","\n","### License\n","CC0: Public Domain\n","\n","### Privacy\n","Thirty eligible Fitbit users gave their consent for the submission of personal tracking data, including minute-level results of physical activity, heart rate, and sleep monitoring. Individual reports can be analyzed by export session ID (column A) or timestamp (column B). The variation between the results represents the use of different types of Fitbit trackers and individual tracking behaviors/preferences.\n","\n","\n","### ROCCC\n","* Reliable: Small sample (30 people), making it less reliable.\n","* Original: Low. Data collected by third parties (Amazon Mechanical Turk).\n","* Comprehensive: Variables lack an explanation.\n","* Current: The dataset is not current, it is 7 years old.\n","* Cited: The data source is appropriately cited.\n","\n","### Use of R\n","\n","The dataset will be analyzed using the R tool and the Kaggle platform.\n","\n","### Data Loading\n","\n","The first step is to prepare the workspace. Once the workspace is chosen (in this case, Kaggle), the dataset will be loaded. In this case, since a notebook was created from the dataset to be used, they are already loaded and saved in a cloud folder on Kaggle.\n","\n","### R Environment Preparation\n","\n","After this, the R environment will be prepared to work on the data. To do this, the following packages need to be loaded for later use."]},{"cell_type":"markdown","id":"b6ffee8a","metadata":{"papermill":{"duration":0.012245,"end_time":"2023-11-13T18:19:50.1886","exception":false,"start_time":"2023-11-13T18:19:50.176355","status":"completed"},"tags":[]},"source":["# Package Installation in R"]},{"cell_type":"code","execution_count":1,"id":"ccccbf75","metadata":{"execution":{"iopub.execute_input":"2023-11-13T18:19:50.217569Z","iopub.status.busy":"2023-11-13T18:19:50.215274Z","iopub.status.idle":"2023-11-13T18:22:42.670971Z","shell.execute_reply":"2023-11-13T18:22:42.668581Z"},"papermill":{"duration":172.473647,"end