rnt calories\", x = \"Steps\", y = \"Burnt Calories\")"]},{"cell_type":"markdown","id":"6430fd5a","metadata":{"papermill":{"duration":0.025538,"end_time":"2023-11-13T18:22:49.393082","exception":false,"start_time":"2023-11-13T18:22:49.367544","status":"completed"},"tags":[]},"source":["In this graph, the relationship between daily steps and calories burned is observed, showing a clear positive trend. This means that **the more steps taken per day, the higher the number of calories burned.** This also **has a positive impact on health** because burning calories through physical activity contributes to maintaining a healthy weight, improves cardiovascular function, enhances mental health, and **overall promotes a better quality of life.**"]},{"cell_type":"markdown","id":"f380d2b8","metadata":{"papermill":{"duration":0.025325,"end_time":"2023-11-13T18:22:49.443566","exception":false,"start_time":"2023-11-13T18:22:49.418241","status":"completed"},"tags":[]},"source":["# Phase 6: Act\n","In this phase, conclusions about the analyzed data will be provided, and suggestions based on the findings for the business task will be given.\n","\n","### Answering the Initial Questions\n","**1. What are some trends in the use of smart devices?**\n","\n","*Some trends in the use of smart devices are focused on health, driven by a greater awareness of overall health and well-being. Users want to monitor daily physical activity, sleep quality and quantity, calories, etc.*\n","\n","**2. How could these trends be applied to Bellabeat's customers?**\n","\n","*Bellabeat could continue to focus on the aforementioned aspects to develop new technology and a broader health data integration to provide customers with more information about their health.*\n","\n","**3. How could these trends help influence Bellabeat's marketing strategy?**\n","\n","*These trends could help Bellabeat communicate how its products align with consumer desires and needs, emphasizing their ongoing commitment to innovation and extensive integration of customer health data.*\n","\n","### Business Task and Recommended Actions\n","The business task is as follows: \"Improve the marketing strategy of the company Bellabeat to increase the customer portfolio.\"\n","\n","The following suggestions are made:\n","1. Use consumer data to **offer personalized services** to customers, such as tips to improve sleep habits, set goals for daily steps, etc. Tailor services to user habits, thus improving customer retention.\n","2. Allow **easy and secure sharing of health data** with the healthcare professionals offered through the Bellabeat membership.\n","3. **Implement AI and machine learning to analyze user health data**, sending notifications when set goals are achieved and when something is outside \"normal\" parameters.\n","\n","Note: It's important to highlight that the findings are based on a small statistical sample (30 people), so it is recommended to expand the sample for future analyses and more precise suggestions.\n","\n","# Acknowledgments\n","**Special thanks to the instructors of the Google Data Analytics Certificate, INROADS, and Google itself for this learning opportunity.**"]}],"metadata":{"kaggle":{"accelerator":"none","dataSources":[{"datasetId":1041311,"sourceId":1752235,"sourceType":"datasetVersion"}],"dockerImageVersionId":30530,"isGpuEnabled":false,"isInternetEnabled":true,"language":"r","sourceType":"notebook"},"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":182.874677,"end_time":"2023-11-13T18:22:49.591472","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2023-11-13T18:19:46.716795","version":"2.4.0"}},"nbformat":4,"nbformat_minor":5}